import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FiExternalLink, FiGithub, FiEye, FiBrain, FiDatabase, FiMic, FiCamera, FiMessageCircle } from 'react-icons/fi';
import './Projects.css';

const Projects = () => {
  const [ref, inView] = useInView({
    threshold: 0.1,
    triggerOnce: true
  });

  const projects = [
    {
      id: 1,
      title: "Species Identification App",
      description: "Detects plant/animal species from images in real-time using CNNs. User-friendly mobile UI with offline support.",
      technologies: ["Python", "TensorFlow", "CNN", "Mobile UI", "Offline Support"],
      icon: <FiCamera size={24} />,
      category: "Computer Vision",
      github: "https://github.com/gownikranthi/species-identification",
      demo: "#",
      featured: true
    },
    {
      id: 2,
      title: "Demand Forecasting Dashboard (Power BI)",
      description: "Predicts meal demand, visualizes delivery metrics using real-world data. Power BI integration.",
      technologies: ["Power BI", "Python", "Time Series", "Data Visualization", "SQL"],
      icon: <FiDatabase size={24} />,
      category: "Data Analytics",
      github: "https://github.com/gownikranthi/demand-forecasting",
      demo: "#",
      featured: true
    },
    {
      id: 3,
      title: "Emotion Detection with LSTM",
      description: "Built an NLP model that detects emotion in dialogue using GoEmotions dataset and LSTM architecture.",
      technologies: ["Python", "LSTM", "NLP", "TensorFlow", "GoEmotions"],
      icon: <FiBrain size={24} />,
      category: "Natural Language Processing",
      github: "https://github.com/gownikranthi/emotion-detection",
      demo: "#",
      featured: true
    },
    {
      id: 4,
      title: "YOLOv5 Object–Subobject Detection",
      description: "Detects primary objects and their subparts (like helmet on person) using YOLOv5 & custom hierarchy logic.",
      technologies: ["YOLOv5", "Python", "Computer Vision", "Object Detection", "Custom Logic"],
      icon: <FiEye size={24} />,
      category: "Computer Vision",
      github: "https://github.com/gownikranthi/yolo-subobject-detection",
      demo: "#",
      featured: true
    },
    {
      id: 5,
      title: "Convolution Image Recognition Chatbot (CIRC)",
      description: "AI chatbot that combines SigLIP for visual input and LLaMA 3 for natural language output.",
      technologies: ["SigLIP", "LLaMA 3", "Python", "AI Chatbot", "Multimodal"],
      icon: <FiMessageCircle size={24} />,
      category: "AI/ML",
      github: "https://github.com/gownikranthi/circ-chatbot",
      demo: "#",
      featured: true
    },
    {
      id: 6,
      title: "EchoSentinel – Voice Surveillance",
      description: "Trigger-word activated security system using Python, speech APIs, and real-time voice segmentation.",
      technologies: ["Python", "Speech APIs", "Real-time", "Security", "Voice Processing"],
      icon: <FiMic size={24} />,
      category: "Audio Processing",
      github: "https://github.com/gownikranthi/echosentinel",
      demo: "#",
      featured: true
    }
  ];

  const categories = ["All", "Computer Vision", "Data Analytics", "Natural Language Processing", "AI/ML", "Audio Processing"];

  return (
    <section id="projects" className="projects section" ref={ref}>
      <div className="container">
        <motion.div
          className="section-header"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6 }}
        >
          <h2>Featured Projects</h2>
          <p className="section-subtitle">
            Showcasing my work in AI/ML, computer vision, and intelligent systems
          </p>
        </motion.div>

        <motion.div
          className="projects-grid"
          initial={{ opacity: 0 }}
          animate={inView ? { opacity: 1 } : {}}
          transition={{ duration: 0.8, delay: 0.2 }}
        >
          {projects.map((project, index) => (
            <motion.div
              key={project.id}
              className="project-card"
              initial={{ opacity: 0, y: 30 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              whileHover={{ y: -8 }}
            >
              <div className="project-header">
                <div className="project-icon">
                  {project.icon}
                </div>
                <div className="project-category">
                  {project.category}
                </div>
              </div>

              <div className="project-content">
                <h3 className="project-title">{project.title}</h3>
                <p className="project-description">{project.description}</p>
                
                <div className="project-technologies">
                  {project.technologies.map((tech, techIndex) => (
                    <span key={techIndex} className="tech-tag">
                      {tech}
                    </span>
                  ))}
                </div>
              </div>

              <div className="project-actions">
                <a
                  href={project.github}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="project-link"
                >
                  <FiGithub size={18} />
                  View Code
                </a>
                <a
                  href={project.demo}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="project-link"
                >
                  <FiExternalLink size={18} />
                  Live Demo
                </a>
              </div>
            </motion.div>
          ))}
        </motion.div>

        <motion.div
          className="projects-cta"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6, delay: 0.8 }}
        >
          <a
            href="https://github.com/gownikranthi"
            target="_blank"
            rel="noopener noreferrer"
            className="btn btn-primary"
          >
            <FiGithub size={18} />
            View All Projects on GitHub
          </a>
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
